import './Card.css';

function Card(props) {
  return (
    <div className='Card'>
      <div className='Card-img-wrapper'>
        <img className='Card-img' src={props.image} alt={props.alt} />
      </div>
      <div className='Card-content'>
        <h3>{props.title}</h3>
        <h4>{props.subtitle}</h4>
        <p>{props.description}</p>
      </div>
    </div>
  );
}

export default Card;
